import "./About.css";
import React, { useState } from "react";
import Aboutus from "./images/About.jpg";

function About() {
    return (
        <div className="about-heading">
            <img src={Aboutus} alt="About us" />
            <h3>About Us</h3>
        </div>
    );
}

export default About;
